import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";

function App() {
  return (
    <div>
      <Header />
      {notes.map(note => (
        <Note
          key={notes[0].id}
          title={notes[0].title}
          content={notes[0].content}
        />
      ))}
      <Footer />
    </div>
  );
}

export default App;
